import React from "react";
import Base from "./Base";

const Cart = () => {

    const loadAllProducts = () => {
        return (
            <div>
                <h1>Products</h1>
            </div>
        )
    }

    const loadCheckout = () => {
        return (
            <div>
                <h1>Checkout</h1>
            </div>
        )
    }
    return(
        <Base title="This is Cart page">
            <h1>Cart Page</h1>
        </Base>
    )
}
export default Cart;
